    [],nt"revision_timestamp": "2016-07-27T22:41:44.833358",nt"name": "baseline-contaminant-assessment-of-water-sediment-invertebrates-and-fish-from-twenty-tribu",nt"isopen":
    false,nt"url": null,nt"notes": "Water quality impairments, dewatering and
    habitat alteration, have been identified as leading causes of the decline of numerous
    fish species in the Great Plains ecosystem. To evaluate the impacts of environmental
    contaminants on these species, biotic and abiotic samples were collected from sites
    at which our target species, Topeka shiner (Notropis Topeka) and Arkansas darter
    (Etheostoma cragini) still exist or have been extirpated. These samples were analyzed
    for a variety of organic and inorganic compounds. At sites where the target species
    are still present, measured chemical concentrations may be used to partially describe
    environmental conditions which support the existence of these species. This information
    may be used to define environmental conditions which would be suitable to support
    future fish population management or reintroduction efforts.",nt"license_title":
